import { Router } from 'express'
import {
  createFavHandler,
  findFavsHandler
} from '../controllers/favs.controller'
import { verifyToken } from '../middlewares';

const favRouter = Router()

favRouter.post('/api/fav',verifyToken, createFavHandler)

favRouter.get(
  '/api/fav',
  verifyToken,
  findFavsHandler
)

export default favRouter
