/*require('')*/
const { Router } = require('express');

const path = require('path');
const { unlink } = require('fs-extra');
const router = Router();

// Models
const Image = require('../models/Image');

const cloudinary= require('cloudinary');
cloudinary.config({
    cloud_name: 'dmc99lkmj',
    api_key: '429392565885329',
    api_secret: 'HSzNIzPlmpQzV_3xWLEwBVVxJpM'
})
router.get('/', async (req, res) => {


    const images = await Image.find();
    
    res.render('index', { images });
});


router.get('/upload', async (req, res) => {
    const { resources } = await cloudinary.search
        .expression('folder:dev_setups')
        .sort_by('public_id', 'desc')
        .max_results(30)
        .execute();

    const publicIds = resources.map((file) => file.public_id);
    res.send(publicIds);
});

/*router.post('/upload', async (req, res) => {
    const image = new Image();
    image.title = req.body.title;
    image.description = req.body.description;
    image.filename = req.file.filename;
    image.path = '/img/uploads/' + req.file.filename;
    image.originalname = req.file.originalname;
    image.mimetype = req.file.mimetype;
    image.size = req.file.size;

    await image.save();
    const result = await cloudinary.v2.uploader.upload(image.path) //para subir a clou
    res.redirect('/');
    console.log(result);
});*/
router.post('/upload', async (req,res)=>{
   // const { title,description} =req.body;
   const image = new Image();
    image.title = req.body.title;
    image.description = req.body.description;
    image.filename = req.file.filename;
    image.path = '/img/uploads/' + req.file.filename;
    image.originalname = req.file.originalname;
    image.mimetype = req.file.mimetype;
    image.size = req.file.size;
    console.log(req.filename);
    const result= await cloudinary.v2.uploader.upload(req.file.path);
    await image.save();
    res.redirect('/');
})


router.get('/image/:id', async (req, res) => {
    const { id } = req.params;
    const image = await Image.findById(id);
    res.render('profile', { image });
});

router.get('/image/:id/delete', async (req, res) => {
    const { id } = req.params;
    const imageDeleted = await Image.findByIdAndDelete(id);
    await unlink(path.resolve('./src/public' + imageDeleted.path));
    const result= cloudinary.v2.uploader.destroy(id);
    res.redirect('/');
});

module.exports = router;

